import React, { Component } from 'react'
import "./css/styles.css";
import "./css/w3schools.css";
import Button from '@material-ui/core/Button';

export default class Intro extends Component {
  render() {
    return (
      <div>
        <img src="blue_back.JPG" alt="background blue" class="introbackdrop" width="1430px" height="900px"/>
        <div class="centered">
          <h3 class="georgia">Hi I'm Caroline!</h3>
          <p class="georgia"> I'm a sophomore at Harvard College studying Computer Science. </p>
          <Button variant="contained" class="andalemono">Download CV</Button>
        </div>
      </div>
    )
  }
}
